import React from 'react';
import PropTypes from 'prop-types';


const Section = (props) => {
  return(
    <section id={props.key} className="container-fluid" style={{height:'100vh'}}>
      <div className="row h-100" style={props.backgroundStyle}>
        <props.body />
      </div>
    </section>
  );
}

Section.propTypes = {
  backgroundStyle: PropTypes.object.isRequired,
  body: PropTypes.node,
  key: PropTypes.string.isRequired
}


export default Section;
